import React, { Component } from 'react'

class InfoBar extends Component {
    renderInfo(){
        if (this.props.node){
            return(
                <tr><td>{this.props.node.Details._id}</td></tr>
            )
        }
        return (
           <tr/>
        )
    }

    render() {
        return (
            <div className="InfoBar">
                <h3 className="title">Details : </h3>
                <table>
                    {this.renderInfo()}
                </table>
            </div> 
        )
    }
}

export default InfoBar
